import React from 'react';
import Task from "./Task";

const Column = ({status}) => {

    return (
        <div className={"project_culomn"}>
            {status.statusName}
            {status.tasks.length === 0 ?
                <h3>no task yet</h3>
                : status.tasks.map(task => {
                return <Task statusId = {status.id} key={task.id} task={task}/>
            })}
        </div>
    );
};

export default Column;
